【特徴】<br>●自動車用ホイール・タイヤの汚れ落とし。<br>●油汚れ、道にたまった汚れ、ブレーキダストを溶かすように<br>洗浄する配合成分です。<br>●強力な泡立ちでホイールにしっかり密着し、頑固な泥も浮き上がらせます。<br>●本品はブランケット剤の作用により、スプレーすると隠れた部分や<br>割れ目にも広がり、しつこい汚れも効果的に洗浄します。<br>●容量：700ml <br><br>【仕様】<br>●品番：A-35 エクストリームホイール&タイヤクリーナー<br>●パッケージサイズ高×幅×厚(mm)：270×124×66<br>●製品寸法高×幅×厚(mm)：270×124×66<br>●重さ：790g<style type="text/css">
